import React from 'react';
import ReactPlayer from 'react-player';

function Home() {
  return (
    <div>
      <h1>Home</h1>
      <ReactPlayer 
        url="/Nature.mp4" 
        controls
        width="100%"
        height="auto"
      />
    </div>
  );
}

export default Home;
